    component : AddTag
  },
  {
    path : '/receiptno',
    name : '/receiptno',
    component : ReceiptNo
  },
  {
    path : '/kiosksender',
    name : '/kiosksender',
    component : KioskSender
  },
  {
    path : '/kioskreceiver',
    name : '/kioskreceiver',
    component : KioskReceiver
  },
  {
    path : '/kioskgoods',
    name : '/kioskgoods',
    component : KioskGoods
  },
  {
    path : '/easymenu',
    name : '/easymenu',
    component : EasyMenu
  },
  {
    path : '/easybarcode',
    name : '/easybarcode',
    component : EasyBarcode
  },
  {
    path : '/easysender',
    name : '/easysender',
    component : EasySender
  },
  {
    path : '/easyreceiver',
    name : '/easyreceiver',
    component : EasyReceiver
  },
  {
    path : '/easygoods',
    name : '/easygoods',
    component : EasyGoods
  },
  {
    path : '/easyinvoiceno',
    name : '/easyinvoiceno',
    component : EasyInvoiceNo
  },
  {
    path : '/easyphoneno',
    name : '/easyphoneno',
    component : EasyPhoneNo
  }

]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
